import React, { useEffect, useState } from "react";

function Home() {
  const [data, setData] = useState();

  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch("http://localhost:3000/register");
      const json = await response.json;
    };

    fetchData();
  }, []);

  return <h2>Home</h2>;
}

export default Home;
